Battle Girlz #3
Publisher:  Antarctic Press
Publication Date:  April 2002

Story and Art by Rod Espinosa

Ever since Yunna immigrated to Arlan and became the newest member of the Imperial Security Force (ISF), she's definitely been finding out that she's signed on for more than she expected! It's training day at the mansion, and Yunna's in for a whole new batch of surprises! She starts off discovering more about her new team while exploring the mansion alone. Then, after a day on the training field, struggling to keep up with the others and hold her own, Yunna follows a mysterious new girl and discovers that there are more members to the SIS than she'd thought!

Thanks goes to Talon for this release.

